var music = [  'http://www.johnboncalos.me/8daudio/billieeu.m4a', 'http://www.johnboncalos.me/8daudio/Met1.m4a', 'http://www.johnboncalos.me/8daudio/TheWarOnDrugs.m4a']
var iM = 0
player.audioLoader = null
function init(){
	console.log('ball', player)

	var i = setInterval( () => {

		if(player.listener === null) return

		player.sound = new THREE.PositionalAudio( player.listener );

		this.add(player.sound)




		setSound()



		if(player.listener !== null){
			clearInterval(i)
		}	

	}, 1000)

}

function setSound(){
	player.audioLoader = new THREE.AudioLoader();
	player.audioLoader.load( music[iM], function( buffer ) {
			player.sound.setBuffer( buffer );
			player.sound.setLoop( false );
			player.sound.setVolume( 1 );
			player.sound.play();
			player.sound.onEnded = () =>{

			}
		});	
	console.log('loaded sound!')

	THREE.Audio.prototype.onEnded = function() {
		console.log('Track Ended!')
		player.sound.stop()
				iM++;
				setSound()
      console.warn("arguments to onEnded!", arguments)
    };
}

